import React from "react";
import Cards from "./Cards";
import Sdata from "./SData";

const Amazon=()=>{
    return(  
        <Cards
        key = {Sdata[1].id}
        imgsrc={Sdata[1].imgsrc}
        title={Sdata[1].title}
        SName={Sdata[1].SName}
        refrence={Sdata[1].refrence}
        />);
}
export default Amazon;
